DROP TABLE IF EXISTS `log_payment`;
CREATE TABLE `log_payment` (
  `remarkid` varchar(50) NOT NULL COMMENT '流水号',
  `areaid` varchar(50) DEFAULT '0' COMMENT '大区编号',
  `worldid` varchar(50) DEFAULT '0' COMMENT '世界编号',
  `dstuin` varchar(50) DEFAULT '0' COMMENT '被充值的qq号',
  `roleid` varchar(50) DEFAULT '0' COMMENT '充值到角色id',
  `rolename` varchar(64) DEFAULT '' COMMENT '充值到角色名称',
  `srcuin` varchar(50) DEFAULT '0' COMMENT '扣费qq号',
  `duid` varchar(50) DEFAULT NULL COMMENT '返现代理Id',
  `source` varchar(50) DEFAULT '0' COMMENT '充值渠道',
  `amount` varchar(50) DEFAULT '0' COMMENT '充值金额',
  `uiip` varchar(50) DEFAULT '0' COMMENT '客户端支付ip',
  `description` varchar(50) DEFAULT '' COMMENT '备注信息',
  `paystatus` varchar(50) DEFAULT '1' COMMENT '充值状态，是否成功，0成功，1失败',
  `paymsg` varchar(100) DEFAULT '' COMMENT '充值成功或失败的信息',
  `createTime` varchar(50) DEFAULT '0' COMMENT '订单创建时间',
  `finishTime` varchar(50) DEFAULT '0' COMMENT '订单成功支付时间',
  `extend1` varchar(50) DEFAULT NULL COMMENT '备用',
  PRIMARY KEY (`remarkid`),
  KEY `dstuin` (`dstuin`),
  KEY `srcuin` (`srcuin`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='充值记录表';

