  `Ur_del` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '0 存在1删除',
  `Ur_errorlogin` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '错误登录次数',
  `Ur_lockTime` datetime DEFAULT NULL COMMENT '账号锁定时间',
  `Ur_lockBindIp` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '账号锁定的IP(以,分割)',
  `Ur_text1` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '用户账号等级,顶级200,超级100,开发90,普通80,用户70',
  `Ur_text2` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '账号管理归属人集合(最多4个人)',
  PRIMARY KEY (`Ur_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

